css:
.refactor-reference .region {
  border-radius: 2px;
  box-sizing: border-box;
  background-color: rgba(54, 175, 144, 0.2);
  border: 1px solid rgba(54, 175, 144, 0.3);
}
.refactor-error .region {
  box-sizing: border-box;
  border-bottom: 1px dotted #ff0000;
}
.gutter .line-number.refactor-error .icon-right {
  visibility: visible;
}
.gutter .line-number.refactor-error .icon-right:before {
  content: "\f02d";
  color: #ff6347;
}
